import React from 'react';


function Homepage() {
    return (
        <>
        
            <h2>Order your items straight to your door!</h2>
            <p>Use the tabs to navigate your way around the site! The store page will allow you to search for
                your nearest store location by entering your zip code. You can also go use the order page to
                view our inventory, and add items to your shopping cart for purchase.   </p>

        
        </>
    );
}

export default Homepage;
